import React from 'react';
import ReactDOM from 'react-dom';


class App extends React.Component {

  constructor(props) {
    super(props);
    this.state = { lat: null };
  }

  render() {

    return <div>Latitude:{this.state.lat}</div>
  }

}

ReactDOM.render(
  <App />,
  document.querySelector('#root')
)
